import React from 'react';
import { render } from 'react-dom';

class App3 extends React.Component {

    render() {
        return (
            <div className="main">
                <h1>Test</h1>
            </div>
        );
    }
}

render(<App3 />, window.document.getElementById('wubalubadubdub'));
